import React from 'react';

const Startbutton = () => {
    const handleClick = () => {
      alert('¡Hiciste clic en el botón!');
    };

    return (
      <button onClick={handleClick}>
        ¡Empezar!
      </button>
    );
  };

  export default { Startbutton };
